import React from "react"

function ManageDetailsView(props) {

    return (
        <div>
            <table className="table">
                <thead>
                    <tr>
                        <th>&nbsp;</th>
                        <th>Name</th>
                        <th>Address</th>
                        <th>Category</th>
                    </tr>
                </thead>
                <tbody>
                    <tr key="1">
                        {
                            Object.keys(props.details).forEach(priKey => {
                                if (!Number.isInteger(parseInt(priKey, 10))) {
                                    return (
                                        <td>
                                            {props.details[priKey]}
                                        </td>
                                    )
                                }
                            }
                            )
                        }
                    </tr>
                </tbody>
            </table>
        </div>
    )
}

export default ManageDetailsView;

